import ProductCard from "../Componets/ProductCard"
import ProjectContent from "../Componets/ProjectContent"

const Projects = () => {
    return (
        <div>
            <h2>
                ~
            </h2><h1 className="Projects">My Projects</h1>

            <div className="Pro">
                {ProjectContent.map(ProjectContent => (
                    <ProductCard
                        key = {ProductContent.id}
                        image = {ProjectContent.image}
                    />
                ))}
            </div>
        </div>
    )
}

export default Projects
